What is “Hecho A Mano Con Amor”?
Hecho A Mano Con Amor is a gift box filled with handmade goods assembled especially for you and sent out monthly. The items selected for each box are based on whichever of our several different themes that you choose. Each gift box is unique (no two boxes are alike!) and filled with high-quality Mexican pieces that we handpick.

How many boxes will I get?
We send out one box at the beginning of each month for the duration of your subscription. You can choose from a 3, 6, or 12 month subscription.

Can I send “Hecho A Mano Con Amor” as a gift?
Of course! You are welcome to purchase and send Hecho A Mano Con Amor for yourself or someone else. Just let us know what address you want your gift box to be sent to in the comments box.

